import React from 'react';

function Nav () {
return(
    <div>
        <img src="/Logo.svg" alt="Logo"/>
        <ul>
            <li><a>Home</a></li>
            <li><a>About</a></li>
            <li><a>Menu</a></li>
            <li><a>Reservation</a></li>
            <li><a>Order Online</a></li>
            <li><a>Home</a></li>
        </ul>
    </div>
)
}

export default Nav;
